import FacebookIcon from '@mui/icons-material/Facebook';


export default {
    name: "Ravin sir is coding",
    title: "Full stack developer",

    birthday:'30th november 1992',
    email:'ravinsharma@gmail.com',
    address:'Kasoli',
    phone:'123 456 7890',



    socials: {
        facebook: {
            link: 'https://www.facebook.com',
            text: 'RavinisCoding',
            icon: <FacebookIcon />

        },
        twitter: {
            link: "https://www.facebook.com",
            text: "MyTwitter",
            icon: <FacebookIcon />

        },
        Linkedin: {
            link: "https://www.facebook.com",
            text: "MyLinkedin",
            icon: <FacebookIcon />

        },
        Github: {
            link: "https://www.facebook.com",
            text: "MyGithub",
            icon: <FacebookIcon />

        },
    },

}
